import React from "react";

const Personalized_data_ProfileSection = (props) => {

        
        switch(typeof props){
            
            case ('object'):
                return <React.Fragment>

                <div>
                    <p>Profile</p>
                    <img></img>
                    <p>{props.id}</p>
                </div>

            

            </React.Fragment>

            case (`undefined`): return;

        }

    }

export default Personalized_data_ProfileSection;
